import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './dist/css/style.css';


class AdminPage extends Component {
    render() {
        return (
            <div>
                {/* ============================================================== */}
                {/* Preloader - style you can find in spinners.css */}
                {/* ============================================================== */}
                <div className="preloader">
                    <div className="lds-ripple">
                        <div className="lds-pos" />
                        <div className="lds-pos" />
                    </div>
                </div>
                {/* ============================================================== */}
                {/* Main wrapper - style you can find in pages.scss */}
                {/* ============================================================== */}
                <div id="main-wrapper" data-navbarbg="skin6" data-theme="light" data-layout="vertical" data-sidebartype="full" data-boxed-layout="full">
                    {/* ============================================================== */}
                    {/* Topbar header - style you can find in pages.scss */}
                    {/* ============================================================== */}
                    <header className="topbar" data-navbarbg="skin6">
                        <nav className="navbar top-navbar navbar-expand-md navbar-light">
                            <div className="navbar-header" data-logobg="skin5">
                                {/* This is for the sidebar toggle which is visible on mobile only */}
                                <a className="nav-toggler waves-effect waves-light d-block d-md-none" href="javascript:void(0)">
                                    <i className="ti-menu ti-close" />
                                </a>
                                {/* ============================================================== */}
                                {/* Logo */}
                                {/* ============================================================== */}
                                <div className="navbar-brand">
                                    <a href="index.html" className="logo">
                                        {/* Logo icon */}
                                        <b className="logo-icon">
                                            {/*You can put here icon as well // <i class="wi wi-sunset"></i> //*/}
                                            {/* Dark Logo icon */}
                                            <img src="../../assets/images/logo-icon.png" alt="homepage" className="dark-logo" />
                                            {/* Light Logo icon */}
                                            <img src="../../assets/images/logo-light-icon.png" alt="homepage" className="light-logo" />
                                        </b>
                                        {/*End Logo icon */}
                                        {/* Logo text */}
                                        <span className="logo-text">
                                            {/* dark Logo text */}
                                            <img src="../../assets/images/logo-text.png" alt="homepage" className="dark-logo" />
                                            {/* Light Logo text */}
                                            <img src="../../assets/images/logo-light-text.png" className="light-logo" alt="homepage" />
                                        </span>
                                    </a>
                                </div>
                                {/* ============================================================== */}
                                {/* End Logo */}
                                {/* ============================================================== */}
                                {/* ============================================================== */}
                                {/* Toggle which is visible on mobile only */}
                                {/* ============================================================== */}
                                <a className="topbartoggler d-block d-md-none waves-effect waves-light" href="javascript:void(0)" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                                    <i className="ti-more" />
                                </a>
                            </div>
                            {/* ============================================================== */}
                            {/* End Logo */}
                            {/* ============================================================== */}
                            <div className="navbar-collapse collapse" id="navbarSupportedContent" data-navbarbg="skin6">
                                {/* ============================================================== */}
                                {/* toggle and nav items */}
                                {/* ============================================================== */}
                                <ul className="navbar-nav float-left mr-auto">
                                    {/* ============================================================== */}
                                    {/* Search */}
                                    {/* ============================================================== */}
                                    <li className="nav-item search-box">
                                        <a className="nav-link waves-effect waves-dark" href="javascript:void(0)">
                                            <div className="d-flex align-items-center">
                                                <i className="mdi mdi-magnify font-20 mr-1" />
                                                <div className="ml-1 d-none d-sm-block">
                                                    <span>Search</span>
                                                </div>
                                            </div>
                                        </a>
                                        <form className="app-search position-absolute">
                                            <input type="text" className="form-control" placeholder="Search & enter" />
                                            <a className="srh-btn">
                                                <i className="ti-close" />
                                            </a>
                                        </form>
                                    </li>
                                </ul>
                                {/* ============================================================== */}
                                {/* Right side toggle and nav items */}
                                {/* ============================================================== */}
                                <ul className="navbar-nav float-right">
                                    {/* ============================================================== */}
                                    {/* User profile and search */}
                                    {/* ============================================================== */}
                                    <li className="nav-item dropdown">
                                        <a className="nav-link dropdown-toggle text-muted waves-effect waves-dark pro-pic" href data-toggle="dropdown" aria-haspopup="true" aria-expanded="false"><img src="../../assets/images/users/1.jpg" alt="user" className="rounded-circle" width={31} /></a>
                                        <div className="dropdown-menu dropdown-menu-right user-dd animated">
                                            <a className="dropdown-item" href="javascript:void(0)"><i className="ti-user m-r-5 m-l-5" /> My Profile</a>
                                            <a className="dropdown-item" href="javascript:void(0)"><i className="ti-wallet m-r-5 m-l-5" /> My Balance</a>
                                            <a className="dropdown-item" href="javascript:void(0)"><i className="ti-email m-r-5 m-l-5" /> Inbox</a>
                                        </div>
                                    </li>
                                    {/* ============================================================== */}
                                    {/* User profile and search */}
                                    {/* ============================================================== */}
                                </ul>
                            </div>
                        </nav>
                    </header>
                    {/* ============================================================== */}
                    {/* End Topbar header */}
                    {/* ============================================================== */}
                    {/* ============================================================== */}
                    {/* Left Sidebar - style you can find in sidebar.scss  */}
                    {/* ============================================================== */}
                    <aside className="left-sidebar" data-sidebarbg="skin5">
                        {/* Sidebar scroll*/}
                        <div className="scroll-sidebar">
                            {/* Sidebar navigation*/}
                            <nav className="sidebar-nav">
                                <ul id="sidebarnav">
                                    <li className="sidebar-item">
                                        <a className="sidebar-link waves-effect waves-dark sidebar-link" href="index.html" aria-expanded="false">
                                            <i className="mdi mdi-av-timer" />
                                            <span className="hide-menu">Dashboard</span>
                                        </a>
                                    </li>
                                    <li className="sidebar-item">
                                        <a className="sidebar-link waves-effect waves-dark sidebar-link" href="pages-profile.html" aria-expanded="false">
                                            <i className="mdi mdi-account-network" />
                                            <span className="hide-menu">Profile</span>
                                        </a>
                                    </li>
                                    <li className="sidebar-item">
                                        <a className="sidebar-link waves-effect waves-dark sidebar-link" href="form-basic.html" aria-expanded="false">
                                            <i className="mdi mdi-arrange-bring-forward" />
                                            <span className="hide-menu">Courses</span>
                                        </a>
                                    </li>
                                    <li className="sidebar-item">
                                        <Link to="" className="sidebar-link waves-effect waves-dark sidebar-link" aria-expanded="false">
                                            <i className="mdi mdi-border-none" />
                                            <span className="hide-menu">Users</span>
                                        </Link>
                                    </li>
                                    
                                   
                                    <li className="sidebar-item">
                                        <a className="sidebar-link waves-effect waves-dark sidebar-link" href="error-404.html" aria-expanded="false">
                                            <i className="mdi mdi-alert-outline" />
                                            <span className="hide-menu">404</span>
                                        </a>
                                    </li>
                                </ul>
                            </nav>
                            {/* End Sidebar navigation */}
                        </div>
                        {/* End Sidebar scroll*/}
                    </aside>
                    {/* ============================================================== */}
                    {/* End Left Sidebar - style you can find in sidebar.scss  */}
                    {/* ============================================================== */}
                    {/* ============================================================== */}
                    {/* Page wrapper  */}
                    {/* ============================================================== */}
                    <div className="page-wrapper">
                        {/* ============================================================== */}
                        {/* Bread crumb and right sidebar toggle */}
                        {/* ============================================================== */}
                        <div className="page-breadcrumb">
                            <div className="row">
                                <div className="col-5 align-self-center">
                                    <h4 className="page-title">Dashboard</h4>
                                </div>
                                <div className="col-7 align-self-center">
                                    <div className="d-flex align-items-center justify-content-end">
                                        <nav aria-label="breadcrumb">
                                            <ol className="breadcrumb">
                                                <li className="breadcrumb-item">
                                                    <a href="#">Home</a>
                                                </li>
                                                <li className="breadcrumb-item active" aria-current="page">Dashboard</li>
                                            </ol>
                                        </nav>
                                    </div>
                                </div>
                            </div>
                        </div>
                        {/* ============================================================== */}
                        {/* End Bread crumb and right sidebar toggle */}
                        {/* ============================================================== */}
                        {/* ============================================================== */}
                        {/* Container fluid  */}
                        {/* ============================================================== */}
                        <div className="container-fluid">
                            {/* ============================================================== */}
                            {/* Email campaign chart */}
                            {/* ============================================================== */}
                            <div className="row">
                                <div className="col-md-8">
                                    <div className="card">
                                        <div className="card-body">
                                            <h4 className="card-title">Sales Ratio</h4>
                                            <div className="sales ct-charts mt-3" />
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-4">
                                    <div className="card">
                                        <div className="card-body">
                                            <h5 className="card-title m-b-5">Referral Earnings</h5>
                                            <h3 className="font-light">$769.08</h3>
                                            <div className="m-t-20 text-center">
                                                <div id="earnings" />
                                            </div>
                                        </div>
                                    </div>
                                    <div className="card">
                                        <div className="card-body">
                                            <h4 className="card-title m-b-0">Users</h4>
                                            <h2 className="font-light">35,658 <span className="font-16 text-success font-medium">+23%</span></h2>
                                            <div className="m-t-30">
                                                <div className="row text-center">
                                                    <div className="col-6 border-right">
                                                        <h4 className="m-b-0">58%</h4>
                                                        <span className="font-14 text-muted">New Users</span>
                                                    </div>
                                                    <div className="col-6">
                                                        <h4 className="m-b-0">42%</h4>
                                                        <span className="font-14 text-muted">Repeat Users</span>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            {/* ============================================================== */}
                            {/* Email campaign chart */}
                            {/* ============================================================== */}
                            {/* ============================================================== */}
                            {/* Ravenue - page-view-bounce rate */}
                            {/* ============================================================== */}
                            <div className="row">
                                {/* column */}
                                <div className="col-12">
                                    <div className="card">
                                        <div className="card-body">
                                            <h4 className="card-title">Latest Sales</h4>
                                        </div>
                                        <div className="table-responsive">
                                            <table className="table table-hover">
                                                <thead>
                                                    <tr>
                                                        <th className="border-top-0">NAME</th>
                                                        <th className="border-top-0">STATUS</th>
                                                        <th className="border-top-0">DATE</th>
                                                        <th className="border-top-0">PRICE</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    <tr>
                                                        <td className="txt-oflo">Elite admin</td>
                                                        <td><span className="label label-success label-rounded">SALE</span> </td>
                                                        <td className="txt-oflo">April 18, 2017</td>
                                                        <td><span className="font-medium">$24</span></td>
                                                    </tr>
                                                    <tr>
                                                        <td className="txt-oflo">Real Homes WP Theme</td>
                                                        <td><span className="label label-info label-rounded">EXTENDED</span></td>
                                                        <td className="txt-oflo">April 19, 2017</td>
                                                        <td><span className="font-medium">$1250</span></td>
                                                    </tr>
                                                    <tr>
                                                        <td className="txt-oflo">Ample Admin</td>
                                                        <td><span className="label label-purple label-rounded">Tax</span></td>
                                                        <td className="txt-oflo">April 19, 2017</td>
                                                        <td><span className="font-medium">$1250</span></td>
                                                    </tr>
                                                    <tr>
                                                        <td className="txt-oflo">Medical Pro WP Theme</td>
                                                        <td><span className="label label-success label-rounded">Sale</span></td>
                                                        <td className="txt-oflo">April 20, 2017</td>
                                                        <td><span className="font-medium">-$24</span></td>
                                                    </tr>
                                                    <tr>
                                                        <td className="txt-oflo">Hosting press html</td>
                                                        <td><span className="label label-success label-rounded">SALE</span></td>
                                                        <td className="txt-oflo">April 21, 2017</td>
                                                        <td><span className="font-medium">$24</span></td>
                                                    </tr>
                                                    <tr>
                                                        <td className="txt-oflo">Digital Agency PSD</td>
                                                        <td><span className="label label-danger label-rounded">Tax</span> </td>
                                                        <td className="txt-oflo">April 23, 2017</td>
                                                        <td><span className="font-medium">-$14</span></td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            {/* ============================================================== */}
                            {/* Ravenue - page-view-bounce rate */}
                            {/* ============================================================== */}
                            {/* ============================================================== */}
                            {/* Recent comment and chats */}
                            {/* ============================================================== */}
                            <div className="row">
                                {/* column */}
                                <div className="col-lg-6">
                                    <div className="card">
                                        <div className="card-body">
                                            <h4 className="card-title">Recent Comments</h4>
                                        </div>
                                        <div className="comment-widgets" style={{ height: '430px' }}>
                                            {/* Comment Row */}
                                            <div className="d-flex flex-row comment-row m-t-0">
                                                <div className="p-2">
                                                    <img src="../../assets/images/users/1.jpg" alt="user" width={50} className="rounded-circle" />
                                                </div>
                                                <div className="comment-text w-100">
                                                    <h6 className="font-medium">James Anderson</h6>
                                                    <span className="m-b-15 d-block">Lorem Ipsum is simply dummy text of the printing and type setting industry. </span>
                                                    <div className="comment-footer">
                                                        <span className="text-muted float-right">April 14, 2016</span>
                                                        <span className="label label-rounded label-primary">Pending</span>
                                                        <span className="action-icons">
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-pencil-alt" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-check" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-heart" />
                                                            </a>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            {/* Comment Row */}
                                            <div className="d-flex flex-row comment-row">
                                                <div className="p-2">
                                                    <img src="../../assets/images/users/4.jpg" alt="user" width={50} className="rounded-circle" />
                                                </div>
                                                <div className="comment-text active w-100">
                                                    <h6 className="font-medium">Michael Jorden</h6>
                                                    <span className="m-b-15 d-block">Lorem Ipsum is simply dummy text of the printing and type setting industry. </span>
                                                    <div className="comment-footer ">
                                                        <span className="text-muted float-right">April 14, 2016</span>
                                                        <span className="label label-success label-rounded">Approved</span>
                                                        <span className="action-icons active">
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-pencil-alt" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="icon-close" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-heart text-danger" />
                                                            </a>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            {/* Comment Row */}
                                            <div className="d-flex flex-row comment-row">
                                                <div className="p-2">
                                                    <img src="../../assets/images/users/5.jpg" alt="user" width={50} className="rounded-circle" />
                                                </div>
                                                <div className="comment-text w-100">
                                                    <h6 className="font-medium">Johnathan Doeting</h6>
                                                    <span className="m-b-15 d-block">Lorem Ipsum is simply dummy text of the printing and type setting industry. </span>
                                                    <div className="comment-footer">
                                                        <span className="text-muted float-right">April 14, 2016</span>
                                                        <span className="label label-rounded label-danger">Rejected</span>
                                                        <span className="action-icons">
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-pencil-alt" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-check" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-heart" />
                                                            </a>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            {/* Comment Row */}
                                            <div className="d-flex flex-row comment-row m-t-0">
                                                <div className="p-2">
                                                    <img src="../../assets/images/users/2.jpg" alt="user" width={50} className="rounded-circle" />
                                                </div>
                                                <div className="comment-text w-100">
                                                    <h6 className="font-medium">Steve Jobs</h6>
                                                    <span className="m-b-15 d-block">Lorem Ipsum is simply dummy text of the printing and type setting industry. </span>
                                                    <div className="comment-footer">
                                                        <span className="text-muted float-right">April 14, 2016</span>
                                                        <span className="label label-rounded label-primary">Pending</span>
                                                        <span className="action-icons">
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-pencil-alt" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-check" />
                                                            </a>
                                                            <a href="javascript:void(0)">
                                                                <i className="ti-heart" />
                                                            </a>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
